from PyQt5 import QtGui
import base64
import os

def Get_logo(image_str):
    ImageStr = base64.b64decode(image_str)
    with open("logo.png", "wb") as logo_text:
        logo_text.write(ImageStr)
    logo_text.close()
    return(QtGui.QIcon("logo.png"))
        
def Remove_logo():
    os.remove("logo.png")
    return 0
        
